"use strict";

function calc() {
	const letters = "abcdefghijklmnopqrstuvwxyz".split("");
	const rexp = new RegExp(letters.map(c => c + c.toUpperCase() + "|" + c.toUpperCase() + c).join("|"), "g");

	const part1 = reactAll(input, rexp);
	const part2 = Math.min(...letters.map(c => reactAll(input.replace(new RegExp(c, "ig"), ""), rexp)));

	return part1 + " " + part2;
}

function reactAll(a, rexp) {
	let cur = a;
	let prev = null;

	while (cur != prev) {
		prev = cur;
		cur = prev.replace(rexp, "");
	}

	return cur.length;	
}

